## B.1.1 Training Specification

Training Update We will consider the following 1-pass SGD with batch size $B$ :

$$
\begin{aligned}
L^{(t)} & =\sum_{s=1}^{B} \sum_{i=n+1}^{n+k} \ell\left(\mathcal{T}\left[w^{(t)}\right]\left(\mathbf{b}^{(t, s)}\right)[i], \mathbf{b}^{(t, s)}[i+1]\right) \\
w^{(t+1)} & =w^{(t)}-\eta_{t} \frac{1}{B} \nabla_{w} L^{(t)}
\end{aligned}
$$

Here $w$ includes $A$ and $W$. We will leave $h$ unchanged for the simplicity of analysis.
